package model;

public class PopisPrognoza {
	private int sat = 0;
	private  double dizanje = 0;
	private  int visinaDizanja = 0;
	
	
	
	public PopisPrognoza() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getSat() {
		return sat;
	}
	public void setSat(int sat) {
		this.sat = sat;
	}
	public double getDizanje() {
		return dizanje;
	}
	public void setDizanje(double dizanje) {
		this.dizanje = dizanje;
	}
	public int getVisinaDizanja() {
		return visinaDizanja;
	}
	public void setVisinaDizanja(int visinaDizanja) {
		this.visinaDizanja = visinaDizanja;
	}
	
	

}
